def longestWPI(hours: list) -> int:  # Incompatible time complexity    length = len(hours)    def good_performance(arr: list) -> bool:        return 2 * sum(list(map(lambda x: 1 if x > 8 else 0, arr))) > len(arr)    for sub_length in range(length, -1, -1):        for i in range(length - sub_length + 1):            if good_performance(hours[i: i + sub_length]):                return sub_length            else:                continue        else:            continue    return 0print(longestWPI([6, 6, 6, 9, 9, 7, 10, 7, 6, 6, 9, 9, 10, 12, 2, 0, 20, 1]))